[env]

[service]
swag_image=swag
swag_image_tag=latest
swag_image_pullPolicy=Never
swag_replicas=1
swag_httpScheme=HTTP
swag_tlssecret=tlssecret-swag
swag_bam_enabled=false
swag_job_enabled=false


spring-rest-api_image=spring-rest-api
spring-rest-api_image_tag=latest
spring-rest-api_image_pullPolicy=Never
spring-rest-api_replicas=1
spring-rest-api_httpScheme=HTTP
